document.getElementById('rsvpButton').addEventListener('click', () => {
    document.getElementById('dialog-2').style.display = 'none'
    document.getElementById('dialog').style.display = 'block'
})

document.getElementById('rejectpButton').addEventListener('click', () => {
    document.getElementById('dialog').style.display = 'none'
    document.getElementById('dialog-2').style.display = 'block'
})

document.getElementById('confirm').addEventListener('click', () => {
    document.getElementById('dialog').style.display = 'none'
})

document.getElementById('confirm-2').addEventListener('click', () => {
    document.getElementById('dialog-2').style.display = 'none'
})


const flowersBase64 = "data:image/png;base64,";

const flowerImg = document.querySelectorAll("img");

flowerImg.forEach((node) => {
  node.src = flowersBase64;
})